		"description": "10. SOBRE A CRIANÇA Identificamos na criança a confiança que o Criador deposita nas mãos da Humanidade. A criança é a canção com que o tempo embala os ouvidos do futuro quanto é a semente, que lançada na terra fértil da nobre orientação, produzirá floração e frutos de esperanças para o amanhã. Atentando para a importância do Espírito que atravessa as horas infantis num corpo pequeno de criança, veremos o quanto espera esse serzinho da maturidade e do equilíbrio dos adultos. Mesmo na condição de estar temporariamente esquecido de si mesmo, o ser não se mostra, por isso, apartado das reminiscências que, do inconsciente, visitam-lhe a consciência, apresentando a sua formidável bagagem de variadas conquistas. Em observar atentamente esse bojo de conquistas devem-se ocupar todos aqueles que lidam com os petizes, desde que informados da realidade da reencarnação. Diversos serão os estímulos recebidos pela criança a cada dia. Estímulos luminosos que anularão suas sombras e depositarão formosuras educacionais e estímulos que alimentarão trevas, que deveriam ser aniquiladas no âmago da alma, para evitar infortúnios. Cada criança é um Espírito inteiro, integral, como delicado circuito capacitado a assimilar toda e qualquer informação que se lhe traga, sem qualquer análise ou seleção, uma vez que o seu mundo psíquico não se acha ainda em condições para discernir com profundidade. Dentro desse prisma, vale a pena não desconsiderar o Espírito na faixa infantil, evitando acumular no seu íntimo as notícias da miséria moral, que o adulto exterioriza através da palavra grosseira ou de baixo nível, que lhe penetra o circuito da mente, desajustando-lhe a infância confiante. Tenha, pois, cuidado com seus pequenos, sem exercer um policiamento neurótico, mas filtrando os conteúdos que os alcançam nessa fase. É muito natural e compreensível que você queira ensinar a seus pequenos coisas \"engraçadas\" que ficarão muito bem nas expressões infantis. Não se esqueça, porém, que a sua criança é um Espírito milenário, que terá acordados seus fulcros íntimos, engrandecidos ou torpes, de conformidade com os estímulos que lhes dê. O que para os pequeninos você apresentar como coisa normal se normalizará em seus caminhos, tornando-se vícios torturantes e indignos ou valores espirituais verdadeiros para a eternidade da Vida. (FINAL DA PARTE 1)",
