		"title": "Seminário \"Nascer, Morrer, Renascer Ainda e Progredir Sempre - Tal é a Lei\". Precisamos falar sobre a Morte",
		"shortDescription": "Seminário \"Nascer, Morrer, Renascer Ainda e Progredir Sempre - Tal é a Lei\".\nRealizado no Sindcomer…",
