		"description": "TEXTO ESTUDADO: Não lhes ensine a agressão, evitando fazer-se agressivo junto deles; não lhes repasse mentira, evitando mentir onde as crianças estejam. Não lhes inocule medos traumatizantes, usando lucidez e lógica na vivência com seus petizes. Faça-os valorizar o trabalho, abençoando-os com sua dedicação e com a sua osperosidade. Não lhes ofereça, em nome de alegrias mundanas e de entusiasmos passageiros, os sabores de alcoólicos quaisquer ou de outros tóxicos, que os amarrarão no madeiro do passado espiritual, quase sempre marcado por desequilíbrios e desrespeito às Supremas Leis. Ensine-lhes a graça, instigue-lhes o bom humor, formente-lhes a descontração e a alegria verdadeira, mas salve as crianças dos males que campeiam no mundo, nesses dias. Estude-lhes as personalidades, desde cedinho, e evite incentivo a tudo que lhes fortifique a vaidade, quanto tudo que lhes desenvolva o orgulho, tanto quanto o que lhes intimide, vedando-lhes grandes possibilidades futuras para uma vivência sã. Saiba que todos aqueles que vivem junto à criança e influem sobre ela têm sua porção de responsabilidade na sua formação feliz ou degenerada, sejam os pais, tios, irmãos, avós e outros que interfiram na vida infantil. Respondem, no nível de sua ação sobre os pequenos, os que elaboram literatura infantil, teatro infantil, quaisquer outros espetáculos ou divertimentos para a petizada. A dose de malícia e de maldade, as fixações destrutivas ou desagregadoras dos valores do Espírito, tudo lhes será devidamente cobrado, na proporção em que tenham mutilado a alma da infância, quando lhes serão creditados todos os valores que ajudem os pequenos a crescer e a ser apartarem da ignorância, da sombra, do equívoco. Nos seus contatos com a criança, pense que, desejando ou não, estará escrevendo em seu serzinho as dantescas tragédias que ajudarão a fazê-la cair ou estagnar ou as felizes lições que lhe servirão como trilha segura de redenção. A criança é, sem contestação, a base do amanhã da Terra, e, como você está destinado a retornar à Terra, amanhã, pela inderrogável lei da reencarnação, atenda bem à sua criança de agora, para que ela bendiga seus passos e sua existência no mundo, futuramente.",
