		"title": "A PRESENÇA DOS PAIS JUNTO AOS FILHOS - vereda familiar - cap 12",
		"shortDescription": "12. ABENÇOE SEU FILHO Quando Deus lhe confia a alma que vem do invisível, dando-lhe a honra da mate…",
		"views": 249,
		"frameUrl": "http://www.youtube.com/embed/AM5_6IOuUa8?wmode=opaque",
		"description": "12. ABENÇOE SEU FILHO Quando Deus lhe confia a alma que vem do invisível, dando-lhe a honra da maternidade e da paternidade, é porque sabe que no meio em que você vive e com os recursos variados ou parcos de que dispõe terá as possibilidades de bem orientá-la para a vida. Não podemos desconsiderar o cômputo de preocupações e esforços que vivem tantos pais para ensejarem a seus descendentes o que há de melhor nas sociedades terrenas, de modo a fazê-los desenvolver-se. Não devemos ignorar quantos sacrifícios fazem muitos pais para darem a seus filhos excelentes possibilidades de conforto, do mundo social. A tudo respeitamos, em verdade, sensibilizando-nos com tamanha boa vontade. Entretanto, precisamos encarecer a importância dos cuidados paternais, sob a luz da realidade espiritual, tão desleixada, esquecida pelos progenitores. Se é válido vacinar os pequeninos contra certas doenças devastadoras, que amedrontam, não devemos olvidar a grandeza de que a constitui a Doutrina de Jesus, como abençoada medicação profilática, a fim de que os filhos tenham estrutura para conseguirem viver no mundo com os valores morais-espirituais, assimilados no lar bem orientado. Pensando que nossos filhos carecem da assistência dos pais, o maior tempo possível, particularmente na fase infantil, evitemos entregá-los a escola, a institutos, creches, jardins, e pré-jardim, quando sejam muito novinhos, preservando-os de tantos problemas de carências, ansiedades e inseguranças, de acordo com a sua estrutura psicológica e emocional. Durante a primeira e segunda infâncias, mais do que nunca, será ultra importante recolha a criança a ternura da convivência do lar, com sua mãe, quando não seja possível esteja com os pais. Não exponhamos a nossa criança aos tormentos do mundo. Se os adultos se sentem agredidos, violentados, perante múltiplas situações, que dizer dos pequenos? Sim, as crianças precisam de sociabilização, entretanto, que as iniciemos nas disciplinas domésticas, no convívio dos seus genitores, alimentando a alma nas fontes do Evangelho, decantado no ambiente familiar. Abençoe seu filho, a cada manhã, a cada anoitecer, sem que ele seja um peso, um estorvo para você. Mantenha-o, um pouco mais, ao lado os seus cuidados, junto à sua vigilância tranqüila e atenta, sob a aura dos seus primeiros ensinos. Muitos tormentos e desestruturações do adolescente, e mesmo da criança, tem começo no desamparo a que os pequenos são submetidos, ou no clima de insegurança a que são expostos. Somente com Jesus a orientar-nos a marcha humana, vendo a grandeza da psicologia delicada da infância, sob a óptica da Doutrina Espírita, conseguiremos orientar os pequeninos para que cumpram seus nobres destinos na Terra, pelo entendimento da anterioridade da alma, da reencarnação, o que nos confere, na condição de pais ou tutores, inabordável responsabilidade perante a confiança com que o Criador honra a Humanidade. Abençoe seu filho, preparando-o para ser feliz.",
