		"frameUrl": "http://www.youtube.com/embed/IFZvlzdDTM4?wmode=opaque",
		"description": "13. A MULHER E SEUS FILHOS\n\n\n\nInequivocadamente, à mulher cabe uma importante quota de contribuição com a Oba de Deus, oferecendo a sua sensibilidade e a sua inteligência em favor da vida. Muito a propósito é a afirmação do Espírito da Verdade, quando situa a tarefa delegada por Deus à mulher como mais importante que à do homem, uma vez que cabe a ela o conduzimento dos homens, dando-lhes as primeiras noções de vida.\n\nJunto a seus filhos é que a mulher encontra as mais exuberantes oportunidades de avançar, em espírito, para alcançar os campos luminosos do progresso pelos quais anela.\n\nNão obstante não possa a mulher prescindir da cooperação do companheiro no processo da orientação dos rebentos, salvo nos casos de provações impostas pela morte ou nas situações em que a irreflexão haja gerado problemas irreversíveis propiciando a sua solidão no esforço de dirigir a prole, é a ela, à mãe, que tocam graves compromissos, pois, por sua contextura físio-psicológica ela guarda as potencialidades necessárias para a realização de seus abençoados misteres.\n\nVivendo numa época de contestação e desencontros éticos, na qual a figura feminina tem sido explorada de absurdas formas, desde a exibição do nu comprometedor, geratriz de conúbios mentais deletérios, até as ideologias libertárias e fascinantes que, se lhe apontam caminhos novos de poder e independência, quase nunca mostram roteiros de equilíbrio ou sensatez, pelos quais possa caminhar com segurança.",
