		"description": "Série Caminhar com Jesus\nPalestra realizada na Quinta-feira dia 20/12/12\nTítulo: O Bom Samaritano\nPalestrante: Graça Maciel\nPassagens:\n\"Um homem descia de Jerusalém a Jericó, e caiu no meio de assaltantes que, após havê-lo despojado e espancado, foram-se, deixando-o semimorto. (Lucas, cap. 10:29-37)\nCasualmente, descia por esse caminho um sacerdote; viu-o e passou adiante. Igualmente um levita, atravessando esse lugar, viu-o e prosseguiu. Certo samaritano em viagem, porém, chegou junto dele, viu-o e moveu-se de compaixão. (Lucas, cap. 10:29-37)\nAproximou-se, cuidou de suas chagas, derramando óleo e vinho, depois colocou-o em seu próprio animal, conduziu-o à hospedaria e dispensou-lhe cuidados. (Lucas, cap. 10:29-37)\nNo dia seguinte, tirou dois denários e deu-os ao hospedeiro, dizendo: 'Cuida dele, e o que gastares a mais, em meu regresso te pagarei'. (Lucas, cap. 10:29-37)\nQual dos três, em tua opinião, foi o próximo do homem que caiu nas mãos dos assaltantes?\" Ele respondeu: \"Aquele que usou de misericórdia para com ele\". Jesus então lhe disse: \"Vai, e também tu, faze o mesmo\". (Lucas, cap. 10:29-37)\n'Em verdade vos digo: cada vez que o fizestes a um desses meus irmãos mais pequeninos, a mim o fizestes' (Mateus cap. 25 : 39)\nEstando em viagem, entrou num povoado, e certa mulher, chamada Marta, recebeu-o em sua casa. Sua irmã, chamada Maria, ficou sentada aos pés do Senhor, escutando-lhe a palavra. (Lucas, cap. 10:38-42)\nMarta estava ocupada pelo muito serviço. Parando, por fim, disse: \"Senhor, a ti não importa que minha irmã me deixe assim sozinha a fazer o serviço? Dize-lhe, pois, que me ajude\". (Lucas, cap. 10:38-42)\nO Senhor, porém, respondeu: \"Marta, Marta, tu te inquietas e te agitas por muitas coisas; no entanto, pouca coisa é necessária, até mesmo uma só. Maria, com efeito, escolheu a melhor parte, que não lhe será tirada\". (Lucas, cap. 10:38-42)",
