		"frameUrl": "//www.youtube.com/embed/oYMunOLREZc?wmode=opaque",
		"description": "Na noite de quinta-feira, 27 de junho de 2013, a Rede Amigo Espírita transmitiu ao vivo a emocionante solenidade nas dependências da Câmara Municipal de Araçatuba encerrando a Semana Dama da Caridade, alusiva à comemoração dos 130 anos de nascimento de Benedita Fernandes, ocorrido neste dia 27.\nNa oportunidade a direção do Hospital Benedita Fernandes recebeu o \"Voto de Aplauso\" da Câmara local. Participaram da mesa dos trabalhos, além do presidente da FEB Antonio César Perri de Carvalho; Cidinha Lacerda, ex-secretária de Assistência Social, que representou o prefeito Cido Sério; o Presidente da Câmara Municipal Dr. Jaime José da Silva; o Secretário da Saúde do município de Araçatuba e Presidente do Conselho Deliberativo do Hospital Benedita Fernandes, Dr. José Carlos Teixeira; o Provedor do hospital Antonio Domingos de Camargo e o vice-provedor Dr. Aparecido Hércules Gimael.\nA abertura do evento se deu com a apresentação do Coral Vozes da Esperança. Em seguida usaram da palavra além dos representantes do Hospital Benedita Fernandes, Cidinha Lacerda, Jaime José da Silva e o orador especialmente convidado para a cerimônia, o presidente da Federação Espírita Brasileira, Antonio César Perri de Carvalho. Autor do livro Dama da Caridade, uma biografia de Benedita Fernandes, César fez uma profunda e brilhante retrospectiva da vida e da obra da homenageada, traçou paralelos da vida de Benedita com os momentos que vivemos na atualidade, falou do momento político, das manifestações populares que se desencadearam pelo país e do papel que o Espiritismo tem desempenhado na revivência da doutrina de Jesus. Foi uma noite inesquecível.",
