		"views": 744,
		"frameUrl": "http://www.youtube.com/embed/5CDQ8H8vDTg?wmode=opaque",
		"description": "A cidade histórica de Ouro Preto (MG) sediou nos dias 30 e 31 de março o \"Seminário Espírita da Região dos Inconfidentes \", tendo como tema central \"O Evangelho e a Atualidade\". O evento foi aberto na noite do dia 30, no Teatro Municipal Casa da Ópera, com apresentações musicais, saudações pelo coordenador Eurípedes Mariano Cunha e pelo presidente da União Espírita Mineira Marival Veloso de Matos, e, palestra pública pelo vice-presidente da FEB Antonio Cesar Perri de Carvalho.\nFoi a primeira vez que este auditório -- o mais antigo teatro das Américas em funcionamento (fundado em 1770) -- recebeu uma promoção espírita. No dia seguinte, o seminário se desenvolveu no Centro de Artes e Convenções da Universidade Federal de Ouro Preto, sendo expositores: Haroldo Dutra Dias (Evangelho aplicado aos Problemas da Transição), Célia Maria Rey de Carvalho (Casos do Livro Paulo e Estêvão Aplicados aos Problemas Atuais), Wagner Gomes da Paixão e Arnaldo Rocha (A Obra de Emmanuel -- Chico Xavier), Antonio Cesar Perri de Carvalho (Missão do Espiritismo no Mundo), Angélica Maia (Instrumentos de Trabalho e Renovação -- Kardec, a Chave). Houve homenagem pelos 102 anos do nascimento de Chico Xavier e, ao final, desenvolveu-se uma mesa redonda com todos os expositores, respondendo a perguntas do público.\nNos dois dias, Wagner psicografou mensagens em público. No Teatro e no Centro de Convenções houve o comparecimento de numeroso público das cidades próximas e também de outras regiões de Minas Gerais. Todo o evento foi transmitido ao vivo pela Rede Amigo Espírita.",
